description:
Angela McCluskey is trying to make the most out of the chance the ad has given her. The former lead singer of the Wild Colonials has released her debut solo CD, The Things We Do, to high acclaim. Recorded in only a few days in New York and Sweden, the album showcases McCluskey's extraordinary, raw vocals.

While the CD includes some upbeat pop tunes -- notably the first single, &quot;It's Been Done&quot; -- McCluskey confesses to preferring the more depressing, melancholy songs. &quot;Give me a good ol' dose of misery anyday,&quot; she says, &quot;I think it's a Scottish thing.&quot;

